const INITIAL_STATE = {
    sections: [
        {
            title: 'hats',
            imageUrl: 'https://i.ibb.co/cvpntL1/hats.png',
            id: 1,
            linkUrl: 'shop/hats'
          },
          {
            title: 'jackets',
            imageUrl: 'https://i.ibb.co/px2tCc3/jackets.png',
            id: 2,
            linkUrl: 'shop/jackets'
          },
          {
            title: 'sneakers',
            imageUrl: 'https://i.ibb.co/0jqHpnp/sneakers.png',
            id: 3,
            linkUrl: 'shop/sneakers'
          },
          {
            title: 'womens',
            imageUrl: 'https://i.ibb.co/GCCdy8t/womens.png',
            size: 'large',
            id: 4,
            linkUrl: 'shop/womens',
          },
          {
            title: 'mens',
            //imageUrl: 'https://i.ibb.co/R70vBrQ/men.png',
            imageUrl: 'https://drive.google.com/u/0/uc?id=1xmqEQ51V8S-dyEbkYgkn_OXmKHzdDBC7&export=download'/**'https://i.pinimg.com/originals/03/b1/06/03b106452b10a7be52fc4e71cbe3a7a0.jpg'**/,
            size: 'large',
            id: 5,
            linkUrl: 'shop/mens',
        }
    ]
}



const directoryReducer = (state= INITIAL_STATE, action) => {
    switch(action.type){
        default:
            return state;
    }
};

export default directoryReducer;
